import Link from 'next/link';
import ProductsPage from './Products';

const HomePage = () => {
    return (
        <div className='container'>
            <div className='topbar'>
                <div className='menu-container'>
                    <Link href='/'>
                        <a className='link'> STOCK </a>
                    </Link>

                    <div>
                        <Link href='/products'>
                        <a className = 'link'> Products</a>
                        </Link>
                    </div>
                    <div>
                        <Link href='/manage'>
                        <a className = 'link'> Manage</a>
                        </Link>
                    </div>
                    <div>
                        <Link href='/profile'>
                            <a className = 'link'>Profile</a>
                        </Link></div>
                </div>
            </div>
            <div className = 'content'>
                {ProductsPage.children}
            </div>
            <style jsx global>{`
            @font-face{
                font-family: Roboto;
                src:url(/static/font/Serithai-Regular.ttf);
                font-weight: 400;
            }
               body{
                        magin:0;
                        font-family:'Roboto';
                }
                `}</style>
            <style jsx>{`
            :globla(body){
                margin:0;
            }
                .topbar{
                    display : flex;
                    flex-direction: row;
                    justify-content:space-between;
                    align-item: center;
                    height: 32px;
                    padding: 0 40px;
                }   
                .menu-container{
                    display :flex;
                   
                }
                .menu-container div{
                    margin-left: 5px;
                }
                .link{
                    text-decoration:none;
                    color: black;
                }      
            `}</style>
        </div>
    )
}

export default HomePage;
